import React from "react";
import MovieCard from "./MovieCard";

function MovieList({ movieListArray }) {
    console.log(movieListArray)
    return (
        movieListArray.map(movie => {
            return(
                <div id="movie-list">
                    <MovieCard key={movie.id} movie={movie}/>
                    <hr></hr>
                </div>
            )
        })
    );
}

export default MovieList;
